CREATE DEFINER=`pics_admin`@`%` PROCEDURE `dw_calc_inherited_user_groups`()
BEGIN


DECLARE	SYSTABLE	VARCHAR(255) DEFAULT 'calc_inherited_user_group';
DECLARE	SYSRIGHT	VARCHAR(40) DEFAULT 'ETL-UPSERT';
DECLARE	Proc_nm		VARCHAR(255) DEFAULT 'dw_calc_inherited_user_groups';
DECLARE	Key_cd		VARCHAR(16) DEFAULT 'PK';
DECLARE RowExists_fg	TINYINT	DEFAULT 0;
DECLARE ProcFailed_fg	BOOLEAN DEFAULT FALSE;
DECLARE	p_id	INT(11) DEFAULT 0;
DECLARE p_lastUsed	DATE DEFAULT "0000-00-00";

PRC:
BEGIN
	
	
	
	TRUNCATE TABLE	calc_inherited_user_group;
	DROP VIEW IF EXISTS	v_active_users;
	DROP VIEW IF EXISTS	v_active_groups;
	DROP VIEW IF EXISTS	v_inherited_group;
	
	CREATE OR REPLACE DEFINER=`pics_admin`@`%` VIEW  	v_active_users
	AS
	SELECT
		u.id
	,	u.name
	,	u.accountID
	,	a.name	accountName
	FROM
		users u
	JOIN
		accounts a 
	ON	u.accountID	= a.id
	WHERE	1
	AND	u.isGroup	= 'No'
	AND	u.isActive	= 'Yes'
	AND	a.status	IN ('Active','Demo')
	;
	
	CREATE OR REPLACE DEFINER=`pics_admin`@`%` VIEW  	v_active_groups
	AS
	SELECT
		u.id
	,	u.name
	,	u.accountID
	,	a.name	accountName
	FROM
		users u
	JOIN
		accounts a 
	ON	u.accountID	= a.id
	WHERE	1
	AND	u.isGroup	= 'Yes'
	AND	u.isActive	= 'Yes'
	AND	a.status	IN ('Active','Demo')
	;
	
	CREATE OR REPLACE DEFINER=`pics_admin`@`%` VIEW  	v_inherited_group
	AS
	SELECT DISTINCT
		c.userID
	,	ug.groupID
	FROM
		calc_inherited_user_group c
	JOIN
		usergroup ug 
	ON 	c.groupID	= ug.userID
	JOIN
		v_active_groups u 
	ON 	u.id	= ug.userID
	JOIN
		v_active_groups g 
	ON	g.id = ug.groupID
	WHERE NOT EXISTS
	(
		SELECT 1 
		FROM
			calc_inherited_user_group ToInsert 
		WHERE 1
		AND	ToInsert.userID		= c.userID 
		AND	ToInsert.groupID	= ug.groupID
	)
	;
	
		userID
	,	groupID
	)
	SELECT DISTINCT
		ug.userID
	,	ug.groupID
	FROM
		usergroup ug
	JOIN
		v_active_users  u 
	ON 	u.id	= ug.userID
	JOIN
		v_active_groups g
	ON 	g.id	= ug.groupID
	;
	
	
	UPDATE	calc_inherited_user_group c
	JOIN
	(
		SELECT
			groupID
		,	COUNT(1) total
		FROM
			calc_inherited_user_group
		GROUP BY
			groupID
	)	g
	ON 	c.groupID	= g.groupID
	SET
		c.usersInGroup	= g.total
	;
	
	DROP VIEW IF EXISTS	v_active_users;
	DROP VIEW IF EXISTS	v_active_groups;
	DROP VIEW IF EXISTS	v_inherited_group;
	
	
	
	
END PRC;

END ;;
