INSERT INTO `email_template` VALUES (2,1100,'Welcome Email','Welcome to PICS, Here is Your Username and Password ','<SubscriptionHeader>Thank you for creating an online account with PICS. All of the information that you have entered has been saved in our system. Please keep this e-mail in the event you forget your password.<br /><br />Below is your login Information.<br/><br/>Username: ${userName}<br /><br />If you forget your password, please <a href = \"http://www.picsorganizer.com/AccountRecovery.action\">Click Here </a>.<br /><br />Please <a href=\" ${confirmLink}\">Click Here</a> to confirm that you have received this email. A separate email will be sent to you to confirm registration once you have completed the process.<br /><br />Thank you,<br />Have a great day!<br />Regards,<br /><br />PICS<br />(949) 387-1940<br />www.picsauditing.com<br /><br />- Problems logging in? Contact Registrations@PICSauditing.com<br />- Questions about Registration with PICS? Registrations@PICSauditing.com<br />- Trying to reach a PICS Customer Service Representative? Contact Info@PICSauditing.com<SubscriptionFooter>',941,'2008-09-29 00:00:00',1029,'2013-07-09 16:53:20','Audit',1,1,'undefined',1,'[\"de\",\"en\",\"es\",\"fi\",\"fr\",\"nl\",\"no\",\"pt\",\"sv\",\"zh\"]');
INSERT INTO `email_template` VALUES (5,1100,'New User Welcome','New PICS User Account Created','Hello <DisplayName>,\n<MyName> has issued you a login for the ${user.account.name} account on PICS.\nPlease log in using the following link to set your password.\n${confirmLink}\nHave a great week,\n<PICSSignature>',941,'2008-09-29 00:00:00',1029,'2013-07-09 16:54:04','User',1,1,'undefined',1,'[\"de\",\"en\",\"es\",\"fi\",\"fr\",\"nl\",\"no\",\"pt\",\"sv\",\"zh\"]');
INSERT INTO `email_template` VALUES (6,1100,'Open Requirements Reminder','Open Requirements Reminder for <AuditTypeName> - Your Action Pending','Dear <ContactName>,\n\nWhile reviewing your account--<CompanyName>--we have determined that you have some outstanding requirements that need to be addressed in regards to your <AuditTypeName>.  We would greatly appreciate it if you could please take the time to review the outstanding requirements on each audit and upload the documents that will satisfy those requirements.\n\n#if( $audit.auditType.id == 2)\nRemember, in order to satisfy the requirements of a <AuditTypeName>, we will need your revised, completed and most up to date copies of your safety programs that include the items required within each section of the <AuditTypeName>.  You can view these requirements by logging on to your account and there will be an \"OPEN TASKS\" window, which will read \"You have open requirements from your recent <AuditTypeName>.\"  This is a link that you can click on to see any categories that may have outstanding requirements to fulfill.\n\nMANUAL AUDIT (Safety Manual Program Audit) HOW TO CLOSE YOUR AUDIT\n\nITEMS THAT ARE NOT APPLICABLE\nIf there is a requirement that, based on your scope of work as a company, is not applicable please provide via email or upload a file explaining why that requirement (program) does not apply. For example if you use forklifts at your own facility, but currently not at the operator\'s facility we will still need to review your forklift program. Keep in mind that there are some items within the audit that are required depending on the facilities such as Awareness Programs (Asbestos, Benzene, H2S and Lead) which will be applicable if you enter into a refinery site. Once we can verify the not applicable items, those requirements will be removed off your <AuditTypeName>.\n\nSAMPLE PROGRAMS TO ASSIST YOU IN WRITING YOUR PROGRAMS\nOnce we have a list of all items that are applicable, we can send you sample programs to assist in updating your safety manual.  Please keep in mind that these programs are only a tool to help your company write their own policy/procedure.  Once you feel that you have updated your program to cover all requirements please email us a copy to review and close out the audit.  You can upload your updated programs online.\n\nIF YOU HAVE UPLOADED A REVISED MANUAL OR ANY OTHER DOCUMENTS SINCE THE AUDIT\nIf you have uploaded a revised manual or any other documents that you feel will close out the outstanding requirements, please let us know by replying to this email and we will check your account to verify receipt and then close out the requirements based on what we have received.\n#end\n#if( $audit.auditType.id == 3)\nRemember, in order to satisfy the requirements of your <AuditTypeName>, we will need training documentation, dated within the past year and signed by your employees in order to close out the <AuditTypeName> Requirements.  You can view these requirements by logging on to your account and there will be an \"OPEN TASKS\" window, which will read \"You have open requirements from your recent <AuditTypeName>.\"  This is a link that you can click on to see any categories that may have outstanding requirements to fulfill.\n\nIMPLEMENTATION AUDIT (TRAINING DOCUMENTATION AUDIT)\nIn order to close out your implementation audit requirements, please send the applicable training documentation (for example tests/quizzes, safety meetings/tailgate meetings, safety council training, site specific training or computer based training) completed within the last year.  If you have any questions on whether or not the training documentation will suffice, please feel free to contact us and we will be more than happy to assist you.\n#end\n\nWe thank you for your time and cooperation in order to assist us in completing our audit process, please login to your account and click on the open task to address the outstanding requirements.  Please upload your documents within the\nupload requirements section on your audit.  You can log in to your account during the process to view any requirements that are still outstanding or to check on your status. We look forward to hearing from you.\n\nThanks,\nPICS\n\nFax number 949-269-9165\n17701 Cowan Ste. 140\nIrvine, CA 92614',941,'2008-09-29 00:00:00',90759,'2013-11-22 13:52:36','Audit',1,0,'undefined',1,'[\"en\"]');
INSERT INTO `email_template` VALUES (9,1100,'Contractor Added','${operator.name} Added You to Their Database','Hi <ContactName>,<br/> \n<br/>\nThis email is to notify you that ${operator.name} has linked your company to the ${operator.name} facility in the PICS database.<br/> \n<br/>\n${operator.name} is requesting your prequalification information, by adding you to their account, so that you can be approved to work at that location.<br/> \n<br/>\nPlease have your Primary Contact log in to your account by <a href=\"http://www.picsorganizer.com/Home.action\">Clicking Here </a>. <br/>\n<br/>\nThen select Billing Details to view your balance. You can then see any new tasks that may be required on your Account Summary page. <br/>\n<br/>\nDepending on your membership level, additional fees may apply. Please contact PICS Customer Service at (800) 506-7427 if you have any questions.<br/>',941,'2008-09-29 00:00:00',1029,'2013-07-09 16:56:09','Contractor',1,1,'Admin',1,'[\"de\",\"en\",\"es\",\"fi\",\"fr\",\"nl\",\"no\",\"pt\",\"sv\",\"zh\"]');
INSERT INTO `email_template` VALUES (10,1100,'Insurance Certificates About to Expire','Insurance certificates about to expire','<SubscriptionHeader>\nThis is an automatic reminder that the following Policies for <CompanyName> have or are about to expire.\n<br/>\n<br/>\n#foreach($outer in $contractor.audits)\n#if($outer.auditType.classType.toString() == \'Policy\')\n#foreach($inner in $contractor.audits)\n#if($inner.id != $outer.id && $inner.auditType == $outer.auditType && $inner.getExpiringPolicies())\n#foreach($operator in $outer.operators)\n#if($operator.status.toString() == \'Pending\' && $operator.visible)\n$inner.auditType.name for $operator.operator.name Expires On $pics_dateTool.format(\'yyyy-MM-dd\',$inner.expiresDate)\n#end\n#end\n#end\n#end\n#end\n#end\n<br/>\n<br/>\nPlease upload a new insurance certificate using the insurance requirements of the above.<br/>\nIf we do not receive this certificate prior to the expiration you may not be permitted to enter the facility.<br/>\nAs always we appreciate your cooperation and are here to answer any questions you may have.<br/>\n<br/>\nThank you,<br/>\n<CSRName><br/>\nPICS<br/>\ntel: <CSRPhone><br/>\nfax: <CSRFax><br/>\n<CSREmail><br/>\n<br/>\n<SubscriptionFooter>',941,'2008-09-29 00:00:00',20952,'2012-01-31 21:06:53','Audit',1,1,'Admin',1,NULL);
INSERT INTO `email_template` VALUES (11,1100,'PQF and Annual Update Verification','PQF and Annual Update Verification for <CompanyName>','<CompanyName>,\n\nUpon review of your PQF and Annual Update I have noticed that there are a few items that need your attention. Please re-upload the following items:\n\n${missing_items}\n\nPlease find the OSHA Forms in the below links.\n\nOSHA Forms in Excel Format\nhttp://www.osha.gov/recordkeeping/new-osha300form1-1-04.xls\nOSHA Recordkeeping Assistance\nhttp://www.osha.gov/recordkeeping/new-osha300form1-1-04.pdf\n\n<MyName>,\nPICS \nP.O. Box 51387\nIrvine CA 92619-1387\n<MyPhone>\n<MyFax>\n<MyEmail>',941,'2008-09-29 00:00:00',37745,'2013-07-02 15:35:42','Audit',1,0,'undefined',0,'[\"de\",\"en\",\"es\",\"fi\",\"fr\",\"nl\",\"pt\",\"sv\",\"zh\"]');
INSERT INTO `email_template` VALUES (12,1100,'PendingPQF','Pending PQF','Hi <ContactName>,\n\nI noticed that you are almost finished with the <CompanyName>\nPrequalification Form (PQF) or Annual Update. \n\nWe are still missing some information, which you can view by logging\nin to your account. You will see Open Tasks listed on the right hand side.\n\nThose questions that we need answered, once you click on the open tasks, will be  \nwritten in green and have a yellow star on the left. Please take a moment \nto review and enter a response for each of these sections.\n\nI can personally assist you with any questions you may have, and if you need assistance \nuploading documents, please feel free to contact me directly.\n\nThank you in advance for answering these questions to complete the PICS process.\n\nHave a great day,\n\n<MyName>,\n<PICSSignature>\n',941,'2008-09-29 00:00:00',940,'2013-04-04 13:06:06','Audit',1,0,'undefined',1,'[\"en\",\"fr\",\"es\",\"de\",\"nl\",\"fi\",\"sv\",\"zh\",\"pt\"]');
INSERT INTO `email_template` VALUES (14,1100,'Audit Confirmation for Auditor','<AuditTypeName> Confirmation','Attn: <AuditorName>\n\nYou are scheduled to perform an <AuditTypeName> with:\n\n<CompanyName>\n#if (${audit.auditType.scheduled})\nThe audit is scheduled on <AuditScheduledDate>.\n#end\n\nIt is your responsibility to confirm all of your Implementation Audit appointments at least one (1) week prior to the scheduled date/time via email or phone call to ensure they have your contact information and can direct any questions to you. Every effort should be made to make sure that the contractors are prepared for the audit so that your time is manageable.\n\nIf you have any questions, please contact your Supervisor.\n\nWe appreciate your time and effort in making the process a pleasant experience for our customers!\n\nThank You,\n\nPICS Auditing, LLC\n',941,'2008-09-29 00:00:00',38048,'2013-03-04 14:24:57','Audit',1,0,'undefined',0,'[\"en\"]');
INSERT INTO `email_template` VALUES (15,1100,'Audit Confirmation for Contractor','NOTICE: Implementation Audit Confirmation','Attn: <CompanyName>\n\nThis is a confirmation email from PICS to remind you that your company has an Implementation Audit scheduled for  <AuditScheduledDate>.\n\nThe Implementation Audit is the review of training documentation based on the policies and procedures located in your safety manual. This audit will also review inspection records of equipment used on-sight, tests, quizzes, safety/tailgate meetings, certifications, etc. Please log in and go to the Implementation Audit tab from the Audits drop down and click on the \"Preview Questions\" link within the toolbar on the left to view the actual questions and material that will be reviewed.\n\nWe have put together a one page \"how to\" document which you should have downloaded when scheduling the audit. This how to document is also located in your Open Tasks box on your account summary. If you have any questions, please contact your designated Customer Service Representative: \n\n<CSRName>\n<CSREmail>\n<CSREmail>\n\nThey can provide you the name and contact of the Safety Professional who will be conducting the Implementation Audit so that you can be prepared for the audit. The more prepared you are, the quicker the process will move.\n\nAdditionally, please note that there is a $199 fee if you do not give us at least a 48-hour cancellation notice.\n\nThank You,\n\n<PICSSignature>',941,'2008-09-29 00:00:00',38048,'2013-08-27 14:30:11','Audit',1,0,'undefined',0,'[\"de\",\"en\",\"es\",\"fi\",\"fr\",\"nl\",\"no\",\"pt\",\"sv\",\"zh\"]');
INSERT INTO `email_template` VALUES (47,1100,'Notice of Facility Removal','Notice of Facility Removal','User:&nbsp;<a href=\"http://www.picsorganizer.com/UsersManage.action?accountId=${permissions.accountId}&user.id=${permissions.userId}&isActive=All&isGroup=\">${permissions.name}</a><br/>\nCon Acct:&nbsp;<a href=\"http://www.picsorganizer.com/ContractorView.action?id=${contractor.id}\">${contractor.name}</a><br/>\nFacility:&nbsp;<a href=\"http://www.picsorganizer.com/FacilitiesEdit.action?id=${operator.id}\">${operator.name}</a><br/><br/>\n\n${permissions.name} from ${permissions.accountName} has removed ${operator.name} from the ${contractor.name} account. Please check their billing data and adjust their Invoices as necessary.<br/>\n<a href=\"http://www.picsorganizer.com/BillingDetail.action?id=${contractor.id}\"><strong>Click Here to check this Contractor\'s Billing Data</strong></a>\n\n<br/><br/>--PICS System',20952,'2010-08-31 14:13:05',46726,'2012-03-05 10:51:56','Contractor',1,1,'Admin',0,'[\"en\"]');
INSERT INTO `email_template` VALUES (51,1100,'Deactivation Email for Operators','Notice of Contractor Deactivation -  <CompanyName>','As you know PICS endeavors to maintain active accounts for all contractors who work at your facility.\n\nThis notification is to inform you that <CompanyName> has either not responded to requests to maintain an active status in the PICS database or has requested to have their account closed.  Deactivation of contractor accounts affects your facility\'s ability to view the prequalification information and more importantly the approval status to perform work.\n\nIf this contractor is working at your facility, please advise PICS on how to proceed.  If you are no longer doing business with them, we can remove them from your active list of contractors.\n\nIf you wish to make contact with them to discuss the situation, their contact information is as follows:\n\nContactName - <ContactName>\nPhone - <PrimaryPhone>\nEmail - <PrimaryEmail>\nAddress\n<PrimaryAddress>\n\nThank you,\nPICS Customer Service\nToll Free 800.506.(PICS)7427\nLocal 949.387.1940\nwww.picsauditing.com\n',1098,'2009-04-10 15:54:06',46726,'2012-03-05 10:48:50','Contractor',1,0,'Admin',1,'[\"en\",\"fr\",\"es\",\"de\",\"nl\",\"fi\",\"sv\",\"zh\",\"pt\"]');
INSERT INTO `email_template` VALUES (55,1100,'AM Flag Changes','Operator Flag Changes','<!DOCTYPE HTML PUBLIC \"-//W3C//DTD XHTML 1.0 Transitional//EN\" \"http://www.w3.org/TR/xhtml1/DTD/xhtml1-transitional.dtd\">\n<html>\n<head>\n</head>\n<body>\n<div style=\"width: 750px; background-color: #002240; padding: 0 15px 0 15px; margin: 0; color: #6699CC; font-weight: normal; font-family: sans-serif; font-size: 11px; border-bottom: 3px solid #4686bf; border-left: 1px solid #002240; border-right: 1px solid #002240;\">\n&nbsp;</div>\n<div style=\"width: 750px; padding: 15px; margin: 0; background-color: white; line-height: 18px; font-family: Helvetica, Arial, sans-serif; font-size: 14px; border-left: 1px solid #002240; border-right: 1px solid #002240;\">\nBelow is a list of Client Sites who have had at least 10 total flag changes as well as 5% of their total flag colors change recently. Please review each one for errors. If you find a flag error, please work with your manager or IT to resolve the problems ASAP. If the flags are due to a valid change, then approve each one and consider reaching out to the client site\'s primary contact to discuss the impact of the changes.\n#if(${changes.size()} > 0)\n<h3 style=\"color: rgb(168, 77, 16)\">Client Site Flag Changes</h3>\n<div>\n<strong>Total Flag Differences: </strong>${totalFlagChanges}<strong>  |  Total Client Sites Affected: </strong>${changes.size()}\n</div>\n<table style=\"border-collapse: collapse; border: 2px solid #003768; background: #f9f9f9;\">\n <thead>\n  <tr style=\"vertical-align: middle; font-size: 13px;font-weight: bold; background: #003768; color: #FFF;\">\n   <td style=\"border: 1px solid #e0e0e0; padding: 4px;\">Client Site</td>\n   <td style=\"border: 1px solid #e0e0e0; padding: 4px;\">Changes</td>\n   <td style=\"border: 1px solid #e0e0e0; padding: 4px;\">Percent</td>\n  </tr>\n </thead>\n <tbody>\n  #foreach( $change in $changes )\n  <tr style=\"margin:0px\">\n   <td style=\"border: 1px solid #A84D10; vertical-align: middle; padding: 4px; font-size: 13px;\"><a href=\"https://www.picsorganizer.com/ReportFlagChanges.action?filter.operator=${change.get(\'id\')}\">${change.get(\'operator\')}</a></td>\n   <td style=\"border: 1px solid #A84D10; vertical-align: middle; padding: 4px; font-size: 13px;\">${change.get(\'changes\')}</td>\n   <td style=\"border: 1px solid #A84D10; vertical-align: middle; padding: 4px; font-size: 13px;\">${change.get(\'percent\')}%</td>\n  </tr>\n  #end\n </tbody>\n</table>	\n#end\n<br />\n<TimeStampDisclaimer>\n</div>\n<div style=\"width: 750px; background-color: #002240; padding: 15px; margin: 0; color: #6699CC; font-weight: normal; font-family: sans-serif; font-size: 11px; border-top: 3px solid #4686bf; border-left: 1px solid #002240; border-right: 1px solid #002240;\">\nCopyright &copy; 2012 PICS\n<a href=\"http://www.picsauditing.com/\" style=\"font-size: 11px; color: #6699CC; padding: 2px;\">http://www.picsauditing.com</a> |\n<a href=\"http://www.picsauditing.com/app/privacy_policy.jsp\" style=\"font-size: 11px; color: #6699CC; padding: 2px;\">Privacy Policy</a>\n</div>\n</body>\n</html>',20952,'2010-12-07 19:53:06',46726,'2012-03-05 09:37:14','Audit',1,1,'undefined',0,'[\"en\"]');
INSERT INTO `email_template` VALUES (59,1100,'Credit Card Expiration','Credit Card Expiration','<CompanyName>\n\nHi <ContactName>,\n\nPlease update your payment method.\n\nYou can update your payment information with these steps:\n\n1. Log into your PICS account.\n2. Hover over \"Contractor Details,\" then click \"Payment Options.\"\n3. Enter your credit card information\n4. Click Submit. \n\nThank you, \n\nPICS\n800.506.7427 x2\nwww.picsauditing.com',2357,'2009-06-29 19:24:32',46726,'2012-03-05 10:46:53','Contractor',1,0,'Admin',0,'[\"en\",\"fr\",\"es\",\"de\",\"nl\",\"fi\",\"sv\",\"zh\",\"pt\"]');
INSERT INTO `email_template` VALUES (70,1100,'Bid Only Contractor Account will be deactivated','Deactivation Notice','Dear <ContactName>,\n\nThis is a friendly reminder that your trial account with PICS will be deactivated on $pics_dateTool.format(\'MM/dd/yy HH:mm\', $contractor.paymentExpires).\n\nPlease login to your account at www.picsauditing.com to update your account to full membership. If you have any questions, please contact PICS Customer Service at 800-506-PICS (7427) \n\nYour PICS Account Can: \n1.	Reduce Insurance Costs \n2.	Generate Thousands in Potential Savings \n3.	Give You Superior Exposure to Potential Clients\n\nWe look forward to working with you.\n\nThank you,\nPICS\n800.506.PICS (7427)\nwww.PICSauditing.com\nPlease DO NOT reply to this email. Send replies to Info@PICSauditing.com\n',951,'2009-10-05 16:13:18',46726,'2012-03-05 10:45:17','Contractor',1,1,'Admin',1,'[\"en\"]');
INSERT INTO `email_template` VALUES (73,1100,'Bid Only Contractor Account Approval','Your Bid Only Account has been Upgraded','Congratulations <CompanyName>,\n\nThis email is to confirm that <MyName> from <MyCompanyName> has approved your company to continue with the PICS audit process. \n\nYour account will be upgraded to full membership and an invoice will be emailed to you. Your flag color also will be affected based on the operator requirements.\n\nPlease login and review your additional audits / requirements to complete on the Open Tasks box on the homepage. \n \nThank you and have a safe year!\n<PICSSignature>\n',1098,'2009-10-07 18:49:49',46726,'2012-03-05 10:39:00','Contractor',1,0,'Admin',0,'[\"en\"]');
INSERT INTO `email_template` VALUES (85,1100,'Password Reset','PICS Password Reset','Attn: <DisplayName>\n<br />\nThis is an automatically generated email that will allow you to set or reset your password. Please click the following link and set your password on the following page.\n<br /><br />\n${confirmLink}\n<br /><br />\nIf you did not request that this email be sent to you or if you have any questions, please contact us.\n<br />\n<PICSSignatureHTML>',1098,'2010-01-15 11:24:16',23157,'2012-03-30 17:49:41','User',1,1,'undefined',0,'[\"en\",\"fr\",\"es\",\"de\",\"nl\",\"fi\",\"sv\",\"zh\",\"pt\"]');
INSERT INTO `email_template` VALUES (86,1100,'Username Reminder','PICS Username Reminder','Attn: <DisplayName>\nThis is an automatically generated email to remind you of your username(s) to log in to the PICS website.\nThe usernames and the accounts associated with this email address are:\n#foreach( $user in $users )\n${user.getUsername()} on ${user.getAccount().getName()}\n#end\nIf you have any questions or did not request that this email be sent to you, please let us know.\n<PICSSignature>',1098,'2010-01-15 11:21:42',23157,'2012-03-30 17:49:27','User',1,1,'undefined',1,'[\"en\",\"fr\",\"es\",\"de\",\"nl\",\"fi\",\"sv\",\"zh\",\"pt\"]');
INSERT INTO `email_template` VALUES (106,1100,'Credit Card Transaction Failure','Credit Card Transaction Failed','There has been a connection malfunction between our payment gateway and PICS during payment by ${permissions.name} (${permissions.userId}) on ${contractor.name} (${contractor.id}) for invoice:\nhttp://www.picsorganizer.com/BillingDetail.action?id=${contractor.id}\nWe cannot determine whether payment was processed successfully. Please check BrainTree to determine whether payment was processed successfully and notify one of the following billing contact(s):\n#foreach( $user in $billingusers )\n${user.getUsername()}: ${user.email} or phone #: ${user.phone}\n#end\n-PICS IT',941,'2010-03-29 09:55:46',46726,'2012-03-05 10:48:24','Contractor',1,0,'Admin',0,'[\"en\",\"fr\",\"es\",\"de\",\"nl\",\"fi\",\"sv\",\"zh\",\"pt\"]');
INSERT INTO `email_template` VALUES (159,1100,'Contractor Risk Level Lowered','Contractor Risk Level Lowered','Hello,\n\nThe following contractor\'s safety risk level has been lowered:\n\n${contractor.name} (https://www.picsorganizer.com/ContractorView.action?id=${contractor.id})\nfrom ${currentSafetyRisk} to ${newSafetyRisk}.\n\nPlease review this adjustment.',38586,'2011-07-01 16:50:10',46726,'2012-03-05 09:42:05','Audit',1,0,'undefined',0,'[\"en\"]');
INSERT INTO `email_template` VALUES (234,1100,'Email Automation: Duplicate Alert','${contractor.name} May be a duplicate ${type}','<!DOCTYPE html PUBLIC \"-//W3C//DTD XHTML 1.0 Transitional//EN\" \"http://www.w3.org/TR/xhtml1/DTD/xhtml1-transitional.dtd\">\n<html>\n	<head>\n		<meta content=\"text/html;charset=UTF-8\" http-equiv=\"content-type\" />\n		<title></title>\n	</head>\n	<body bgcolor=\"#efefef\" style=\"font-family: Arial,Helvetica,sans-serif; font-size: 13px; color: rgb(0, 0, 0); background-color: rgb(239, 239, 239); padding-top: 15px;\" text=\"#646464\" vlink=\"#81b2da\">\n		<div style=\"width: 600px; margin: 0pt auto;\">\n			<table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" width=\"600\">\n				<tbody>\n					<tr>\n						<td bgcolor=\"#FFFFFF\" style=\"border: 7px solid rgb(210, 211, 213);\">\n							<table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" width=\"600\">\n								<tbody>\n									<tr>\n										<td style=\" padding-right: 20px; padding-left: 20px; padding-top: 13px; padding-bottom: 0px;\">\n											<div style=\"font-size: 28px; margin: 0 0 10px 0\">\n												<img alt=\"PICS\" height=\"90\" src=\"https://df6357ff93-custmedia.vresp.com/bec3081db6/logo-pics%202.jpg\" style=\"width: 205px; height: 90px; \" title=\"PICS\" width=\"205\" /></div>\n										</td>\n									</tr>\n									<tr>\n										<td bgcolor=\"#d2d3d5\" style=\"font-size: 3px;\">\n											&nbsp;</td>\n									</tr>\n									<tr>\n										<td style=\"padding: 0px 22px 15px 23px;\">\n											<div style=\"line-height: 18px; margin-top: 0px; margin-right: 0px; margin-bottom: 10px; margin-left: 0px; \">\n												<br />\n												Registration Team,<br />\n												&nbsp;<br />\n												The ${type} for <br /><br /><b>${contractor.name} (${contractor.id})</b> <br />\n												<br />\n												may be a duplicate of one of these active contractors: <br />\n												   #foreach( $dup in $duplicates )\n													<br /><b>${dup.name} (${dup.id})</b>\n												   #end\n												<br />\n												<br />\n												Please examine if this is true and take over any further communication with this ${type}.<br />\n												<br />\n												<b>${type} Automated Email System :)</b><br />\n												PICS, Inc.<br />\n												17701 Cowan #140, Irvine, CA 92614<br />\n											</div>\n										</td>\n									</tr>\n									<tr>\n										<td bgcolor=\"#d2d3d5\" style=\"font-size: 3px;\">\n											&nbsp;</td>\n									</tr>\n									<tr>\n										<td style=\"padding-top: 10px; padding-right: 10px; padding-bottom: 10px; padding-left: 23px; line-height: 16px; \">\n											<div style=\"font-size: 11px; text-align: center; color: rgb(105, 105, 105); \">\n												<p style=\"margin-top: 0in; margin-right: 0in; margin-left: 0in; margin-bottom: 0.0001pt; \">\n													&bull;&nbsp;Irvine, CA, USA &bull; Houston, TX, USA</p>\n												<p style=\"margin-top: 0in; margin-right: 0in; margin-bottom: 0pt; margin-left: 0in; padding-top: 0px; padding-right: 0px; padding-bottom: 0px; padding-left: 0px; \">\n													&nbsp;&bull;&nbsp;Abu Dhabi, United Arab Emirates&nbsp;&bull; Calgary, Canada&nbsp;&bull; Hong Kong, China&nbsp;<br />\n													&bull; Johannesburg, South Africa&nbsp;&bull; Maidenhead, U.K.&nbsp;&bull;&nbsp;Munich,&nbsp;Germany&nbsp;&bull; Paris, France<br />\n													&nbsp;&bull; Rio de Janiero, Brazil&nbsp;&bull; Sydney, Australia &bull;&nbsp;Singapore &bull; Tokyo, Japan&nbsp;\n													<br /><br />\n													<b>Toll Free:</b>&nbsp;1-800-506-PICS (7427) &nbsp;| &nbsp;<b>International:</b>&nbsp;+1-949-936-4500<br />\n													Copyright &copy; 2012 PICS. All rights reserved.&nbsp;<a href=\"http://www.picsauditing.com/\" style=\"color: rgb(0, 36, 65); text-decoration: none; \">www.picsauditing.com</a></p>\n											</div>\n										</td>\n									</tr>\n								</tbody>\n							</table>\n						</td>\n					</tr>\n				</tbody>\n			</table>