INSERT INTO `email_template` VALUES (247,1100,'notifyUpcomingImplementationAudit','How to Prepare for your Implementation Audit','<b><u>How to Prepare for your Implementation Audit</u></b>\n<br>\nDuring the audit a PICS Safety Professional will review and verify that training is \nconducted covering the exposures your employees face in the course of their work \nwithin any part of your company.  Please gather training records, from the last 12-\n18 month period, in the form of certificates, cards, rosters of completed training, \nsafety meetings, completed exams/quizzes, etc.   An example  of  an  applicable \nexposure can include operating a forklift within your facility but not onsite at the \noperators facility during a particular job.  In this case, even though you do not \noperate the forklift at the operators site, it is still an exposure within your \ncompany and therefore please gather the appropriate training records to provide \nduring the audit.    For additional information, please review the steps below or \ncontact the safety professional assigned to the audit.\n<br>\nStep 1\n<br>\nOnce you have scheduled your Implementation Audit, please log into your PICS account and go \nto your Open Tasks box.  Within that box you will find an item that states, Prepare for your \nupcoming Implementation Audit.  Once you click on it, you will see a toolbar on the left hand \nside and one of the items will be Print Audit, please click on it.  After you click on it and the \nquestions appear, please click on the Printer Icon at the top of the page, this will enable you to \nprint out all of the questions that will be asked during your upcoming Implementation Audit.\n<br>\nStep 2\n<br>\nPlease gather several examples for the items within the questionnaire that apply to your company \nand your policies, procedures and hazards associated for the type of work you perform.  All of \nthe documentation provided throughout the audit should be dated within the past 12-18 months.  \nPlease be advised that the auditor may randomly select to review documentation on specific \nemployees at the auditors discretion.  The following is a breakdown of the categories and short \nexplanations on what we will be looking for.\n<ul>\n<li> Category 1  General questions we will ask to make sure your account is up to \ndate, you do not need to provide anything in specific for this section unless the \nauditor identifies deficiencies within your PQF, Annual Updates (OSHA Logs,\n& EMR or WCB) or Manual Audit/COR Audit.</li>\n<li> Category 2  Please gather several completed examples of the 4 documents \nrequested within this section.  If you do not currently have samples, please let us \nknow and we will assist you with some that you can use as a tool to create your \nown with.  If you have not had to issue a disciplinary action, please still provide \nthe sample form that you would use in that case.</li>\n<li> Category 3  Please gather several completed examples of an accident/near \nmiss report.  Please make sure that you have a root cause analysis section of how \nthe incident occurred and also a corrective action section on the form showing how you will make sure that the corrective action is communicated to the \nemployees.  If you have not had a recent accident/near miss, please still provide \nthe blank form you would use in case the situation were to arise.</li>\n<li> Category 4  For the first item in this section we will ask you where applicable\nposters (State & Federal or Provincial) are posted and all we will require is a\nverbal response.  For the other items within this section, please provide samples \nof completed training to satisfy the items in question within this section.  For the \nfinal item within this section (4.1.9), please gather several examples of \ncompleted inspection for the types of critical pieces of equipment that you own \nor operate.  For example this includes: cranes, forklifts, manlifts, safety \nharnesses, rigging equipment, gas monitors, etc.</li>\n<li> Category 5, 6, 7, 8, 9 and 10  Please gather several completed examples of \ndocumented training for the topics which are applicable to your company and \nthe type of work that you perform.  Keep in mind that if the hazard is one that \nyou face because of the type of facility you enter, you will also need to provide \ndocumented and completed training on the topic.  This training can be in the \nform of a combination of safety/tailgate meetings, certificates, quizzes, tests, \nsafety council, etc.  For items such as crane operators and forklift operators we \nwill need operator cards, certificates, etc.  If you have questions on whether or \nnot the documentation you have will suffice, please contact your auditor.  You \nwill find the auditors name and contact information within the Implementation \nAudit within your account.</li>\n</ul>',63932,'2012-07-05 17:19:51',63932,'2012-07-06 11:44:55','Audit',1,1,'undefined',0,'[\"en\",\"fr\",\"es\",\"de\",\"nl\",\"fi\",\"sv\",\"zh\",\"pt\"]');
